        <!-- Form busqueda avanzada -->
        <div class="box box-hidden">
            <div class="form-container">
                <div class="row"><h2>Búsqueda avanzada</h2></div>
                <div class="row">
                    <div class="col-25">
                        <label for="tipoProyecto">Tipo de proyecto</label>
                    </div>
                    <div class="col-25">
                        <label class="chkbox-container">
                            Legislativo
                            <input id="proyectoLeg" name="proyectoLeg" value="1" type="checkbox" checked="checked" />
                            <span class="chkbox-checkmark"></span>
                        </label>
                    </div>
                    <div class="col-25">
                        <label class="chkbox-container">
                            Acuerdo
                            <input id="proyectoAcu" name="proyectoAcu" value="1" type="checkbox" checked="checked" />
                            <span class="chkbox-checkmark"></span>
                        </label>
                    </div>
                    <div class="col-25">
                        <label class="chkbox-container">
                            Resolución
                            <input id="proyectoRes" name="proyectoRes" value="1" type="checkbox" checked="checked" />
                            <span class="chkbox-checkmark"></span>
                        </label>
                    </div>
                </div>

                <div class="row">
                    <div class="col-25">
                        <label for="usrQueryAdv">Palabra o frase</label>
                    </div>
                    <div class="col-75">
                        <input type="text" id="usrQueryAdv" name="usrQueryAdv" maxlength="50" />
                    </div>
                </div>

                <div class="row">
                    <div class="col-25">
                        <label>Criterio de b&uacute;squeda</label>
                    </div>
                    <div class="col-25">
                        <label class="radio-container">
                            Todas las palabras
                            <input type="radio" id="criterioT" name="criterio" value="T" checked="checked">
                            <span class="radio-checkmark"></span>
                        </label>
                    </div>
                    <div class="col-25">
                        <label class="radio-container">
                            Algunas palabras
                            <input type="radio" id="criterioA" name="criterio" value="A">
                            <span class="radio-checkmark"></span>
                        </label>
                    </div>
                    <div class="col-25">
                        <label class="radio-container">
                            Frase exacta
                            <input type="radio" id="criterioE" name="criterio" value="E">
                            <span class="radio-checkmark"></span>
                        </label>
                    </div>
                </div>
